//Given a string, find the length of the longest substring without repeating characters.
#include<stdio.h>
#include<string.h>
//function to check for repetition in a substring whose starting index and ending index are provided
int repetition(char*s, int start,int end)
{
  int n=(end-start);
  for(int i=start;i<end;i++)
  {
    for(int j=i+1;j<=end;j++)
    {
      if(s[i]==s[j])
      {
        return 1;
      }
    }
  }
  return 0;
}
//function to find the longest substring without repeating characters
int lengthOfLongestSubstring(char* s)
{
  int str_len=strlen(s);
  if(str_len==0)
  return 0;
 //if strlen is 1
 if(str_len==1)
 {
   return 1;
 }
 //pass all possible substrings of the string to the repetition function
 //let PSL be the present string length that ranges from 2 to str_len
 int PSL=2;
 //Let MAX_LEN be the maximum length of substring without repeating characters
 int MAX_LEN=1;
 while(PSL<=str_len)
 {
 for(int i=0;i<=str_len-PSL;i++)
 {
   int j=i+PSL-1;
   if((repetition(s,i,j)==0)&&(PSL>MAX_LEN))
   {
     MAX_LEN=PSL;
     break;
   }
 }
 //increment PSL by 1
 PSL++;
}
return MAX_LEN;
}
